import React, { useState } from "react";

const App = ()=>{
  let input = "";
  const inputEvent = (e)=>{
    input += e.nativeEvent.data;
    console.log(input);
  }
  return (
    <>
      <div>
        <h1>Hello</h1>
        <input type="text" placeholder="Enter Your Name" onChange={inputEvent}></input>
        <button>Click Here</button>
      </div>
    </>
  )
}

export default App;
